func MyPack(w io.Writer, v interface{}) (int, error) {
	return Pack(w, v, false)
}

func MyUnpack(r io.Reader) (interface{}, int, error) {
	return Unpack(r, false)
}

func TestPackPositiveFixnum(t *testing.T) {
	b := new(bytes.Buffer)
	n, err := MyPack(b, uint8(3))
	if err != nil {
		t.Error(err)
	}
	if n != 1 {
		t.Fatalf("should have returned 1 byte (got %d)", n)
	}
	if b.Bytes()[0] != byte(3) {
		t.Fatal("byte doesn't match")
	}
}

func TestPackNegativeFixnum(t *testing.T) {

	tester := func (i int8) {
		b := new(bytes.Buffer)

		n, err := MyPack(b, i);
		if err != nil {
			t.Fatal(err)
		}
		if n != 1 {
			t.Fatal("should have returned 1 byte")
		}
		if b.Len() != 1 {
			t.Fatal("buffer should be one byte long")
		}

		var x interface{}
		x, n, err = MyUnpack(b)

		if err != nil {
			t.Fatal(err);
		}

		if n != 1 {
			t.Fatal("Unpack should have consumed only 1 byte");
		}

		if x.(int8) != i {
			t.Error("byte doesn't match")
		}

	}
	tester(-1);
	tester(-13);
	tester(-32);
}

