type MyHandler struct {
	t    *testing.T
	proc string
}

func (myh *MyHandler) Handle(proc string, arg jsonw.Wrapper) (res jsonw.Wrapper, e error) {
	if proc != myh.proc {
		e = fmt.Errorf("process %s was not found; I only handle %s", proc, myh.proc)
	} else {
		a, e1 := arg.AtKey("a").GetInt()
		b, e2 := arg.AtKey("b").GetInt()
		var msg string
		if e1 != nil {
			msg = fmt.Sprintf("In getting a: %s", e1)
		} else if e2 != nil {
			msg = fmt.Sprintf("In getting b: %s", e2)
		}
		if len(msg) == 0 && a != b {
			msg = fmt.Sprintf("Value error: %d != %d", a, b)
		}
		res = *jsonw.NewDictionary()
		if len(msg) == 0 {
			res.SetKey("status", jsonw.NewInt(0))
		} else {
			res.SetKey("status", jsonw.NewInt(10))
			res.SetKey("error", jsonw.NewString(msg))
		}
	}
	return
}

func NewHandler(t *testing.T, proc string) (myh *MyHandler) {
	myh = new(MyHandler)
	myh.t = t
	myh.proc = proc
	return
}

func runServer(addr string, proc string, t *testing.T) {
	srv := NewServer(addr, true, NewHandler(t, proc))
	if e := srv.ListenAndServe(); e != nil {
		t.Fatal("Failed to start server")
	}
}

func doClientTest(t *testing.T, proc string, cli *Client, arg *jsonw.Wrapper) {

	res, e := cli.CallSync(proc, arg)
	if e != nil {
		t.Fatalf("problem in call to %s: %s\n", proc, e)
	} else if i, _ := res.AtKey("status").GetInt(); i != 0 {
		msg, _ := res.AtKey("error").GetString()
		t.Fatalf("Equality failed: %s", msg)
	}
}

func TestClientAndServer(t *testing.T) {
	addr := "localhost:9913"
	proc := "test.1.test"
	go runServer(addr, proc, t)
	cli, e := NewClient(addr, true)
	if e != nil {
		t.Fatalf("problem in connect: %s", e)
	}

	arg := jsonw.NewDictionary()
	arg.SetKey("a", jsonw.NewInt(1234))
	arg.SetKey("b", jsonw.NewInt(1234))
	doClientTest(t, proc, cli, arg)

	arg.SetKey("a", jsonw.NewInt(1235))
	res, e2 := cli.CallSync(proc, arg)
	if e2 != nil {
		t.Fatalf("problem in call to %s: %s\n", proc, e2)
	} else if i, _ := res.AtKey("status").GetInt(); i == 0 {
		t.Fatalf("Did not expect equality!\n")
	}
	arg.SetKey("a", jsonw.NewInt(1234))

	res, e = cli.CallSync("0dice", arg)
	if e == nil {
		t.Fatalf("Expected an error, didn't get it")
	} else {
		fmt.Printf("Got back error as expected: %s\n", e)
	}
	cp := NewClientPool(addr, true)

	poolcli, e3 := cp.Get()
	if e3 != nil {
		t.Fatalf("Failed to get from pool: %s\n", e3)
	}
	doClientTest(t, proc, poolcli, arg)
	poolcli2, e4 := cp.Get()
	if e4 != nil {
		t.Fatalf("Failed to get from pool: %s\n", e4)
	}
	doClientTest(t, proc, poolcli2, arg)
	cp.Put(poolcli)
	poolcli, e3 = cp.Get()
	if e3 != nil {
		t.Fatalf("Failed to get from pool: %s\n", e3)
	}
	doClientTest(t, proc, poolcli, arg)
}

