func TestPackUnpackInt(t *testing.T) {
	b := new(bytes.Buffer)
	MyPack(b, uint8(3))
	x, n, err := MyUnpack(b)
	if err != nil {
		t.Fatal(err)
	}
	if n != 1 {
		t.Fatalf("expected unpack to consume one byte (got %d)", n)
	}
	if x.(uint8) != 3 {
		t.Fatal("exepected unpack to return 3")
	}

	c := new(bytes.Buffer)
	MyPack(c, -2147483640)
	y, n, err := MyUnpack(c)
	if err != nil {
		t.Fatalf("unpack err: %s", err)
	}
	if n != 5 {
		t.Fatalf("expected unpack to consume 5 bytes, not %d", n)
	}
	if y.(int32) != -2147483640 {
		t.Fatalf("expected pack/unpack of int32 to work, got %d", y.(int32))
	}
}

