func TestPackUnpackByteArray(t *testing.T) {
	b := new(bytes.Buffer)
	n, err := MyPack(b, []byte{0x34, 0x56, 0x78, 0x90})
	if n != 5 || b.Len() != 5 {
		t.Fatalf("expected pack to make 5 bytes, not %d/%d (%s)\n", n, b.Len(), b)
	}
	x, n, err := MyUnpack(b)
	if err != nil {
		t.Fatal(err)
	}
	if n != 5 {
		t.Fatalf("expected unpack to consume 5 bytes, not %d", n)
	}
	ba := []byte(x.(string))
	if ba[0] != 0x34 || ba[1] != 0x56 || ba[2] != 0x78 || ba[3] != 0x90 {
		t.Fatal("unpack didn't match")
	}
}

