func TestPackUnpackMap(t *testing.T) {
	tmp := func(t *testing.T, framed bool) {

		b := new(bytes.Buffer)
		m := make(map[string]int)
		m["s1"] = 78
		m["t"] = 3600
		m["i"] = 60
		m["o"] = 0
		n, err := Pack(b, m, framed)
		if err != nil {
			t.Fatal(err)
		}
		s := 16
		if framed {
			s += 1
		}
		if n != s {
			t.Fatalf("expected packed size to be 16, not %d", n)
		}

		x, n, err := Unpack(b, framed)
		if err != nil {
			t.Fatal(err)
		}
		if n != s {
			t.Fatalf("expected unpack to consume 16 bytes, not %d", n)
		}
		fmt.Printf("unpacked map: %s\n", x)
		y := x.(map[string]interface{})
		fmt.Printf("y[s1] = %d\n", y["s1"])
	}
	tmp(t, false)
	tmp(t, true)
}

func TestBiggishVector(t *testing.T) {
	tmp := func(t *testing.T, framed bool, L int) {
		v := make([]uint64, L, L)
		b := new(bytes.Buffer)
		for i := 0; i < L; i++ {
			v[i] = uint64(127*i*i*i - 3*i*i - 5*i + 161)
		}
		n, err := Pack(b, v, framed)
		if err != nil {
			t.Fatal(err)
		}
		x, n2, err := Unpack(b, framed)
		if err != nil {
			t.Fatal(err)
		}

		if n != n2 {
			t.Fatalf("different bytes in %d and out %d\n", n, n2)
		}
		w := jsonw.NewWrapper(x)
		for i := 0; i < L; i++ {
			if x, e := w.AtIndex(i).GetUint64(); e != nil {
				t.Fatalf("error access at index %d: %s", i, e)
			} else if x != v[i] {
				t.Fatalf("mismatch at index %d: %d v %d", i, x, v[i])
			}
		}
	}
	tmp(t, false, 10)
	tmp(t, true, 10)
	tmp(t, false, 5)
	tmp(t, true, 5)
	tmp(t, false, 8)
	tmp(t, true, 8)
	tmp(t, false, 15)
	tmp(t, true, 15)
	tmp(t, false, 16)
	tmp(t, true, 16)
	tmp(t, false, 17)
	tmp(t, true, 17)
	tmp(t, false, 20)
	tmp(t, true, 20)
	tmp(t, false, 100)
	tmp(t, true, 100)
	tmp(t, true, 1000)
	tmp(t, true, 10000)
	tmp(t, true, 100000)
}

